import React from "react";

function SurveyComponent(props) {
    return (
        <div>
            <label>Questions </label>
            <select
                name="answers"
                value={props.data.answers}
                onChange={props.handleChange}

            >
                <option></option>

            </select>

        </div>
            )
        }

export default SurveyComponent;
